// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;
import "../Ownable.sol";
/**
 * @title ClassA
 * @dev This is an example of a class contract.
 */
contract NormUserClass is Ownable {
    /// @dev Event emitted when a function in ClassA is called.
    event FunctionCalled(address indexed caller, uint256 value);
    event userAdded(address indexed _user);
    event userDeleted(address indexed _user);
    event TransactionSumUpdated(uint256 sum, uint256 blockNumber);

    struct TwapValueStruct {
        uint256 currentBlock;
        uint256 totalValue;
    }
    uint public twapIndex = 0;
    /// @dev Running total of transaction values
    uint256 private transactionSum;

    /// @dev Block number when the sum was last updated
    uint256 private lastUpdateBlock;
    mapping(uint => TwapValueStruct) public TwapValueStorage;
    mapping(address => bool) public UserList;

    address public classRegistry;
    int256 public classBasis;
    bool public upOrDown;

    constructor( int _classBasis) {

        classBasis = _classBasis;


    }

     modifier onlyRegistry() {
         require(msg.sender == classRegistry, "Only registry can call");
        _;} 


    function updateClassRegistry(address registry)external onlyOwner{
        classRegistry = registry;

    }

    function getUpDown()public view returns(bool) {
        return upOrDown;
    }

    function getClassBasis()public view returns(int256) {
        return classBasis;
    }

    function storeValueOfTx(uint value)external onlyRegistry{
         transactionSum += value;

        // Check if 100 blocks have passed since the last update
        if (block.number >= lastUpdateBlock + 100) {
          TwapValueStruct memory valueStorage =  TwapValueStruct({
                currentBlock: block.number,
                totalValue: transactionSum
            });
            TwapValueStorage[twapIndex] = valueStorage;
            twapIndex ++;
            emit TransactionSumUpdated(transactionSum, block.number);
            transactionSum = 0;
            lastUpdateBlock = block.number;
        }
    }


    function addUser(address user)external onlyRegistry returns(bool){
                require(UserList[user] != true, "User already added to class");
                UserList[user] = true; 
                emit userAdded(user);
                return true;

       }

    function deleteUser(address user)external onlyRegistry returns(bool){
                require(UserList[user] == true, "Cant delete a user not in the class");
                UserList[user] = false; 
                emit userDeleted(user);
                return true;

       }


}

